import React from 'react';
import ReactDOM from 'react-dom';
import {add,sub,mult,div} from "./Calc";

ReactDOM.render(
    <>
     <ul>
         <li>The Addition of two number is{add(40,4)}</li>
         <li>{sub(30, 2)}</li>
         <li>{mult(30, 2)}</li>
         <li>{div(30, 2)}</li>

     </ul>
    </>,
    document.getElementById("root")

);
